import './App.css';
import StudentDetails from './lab09';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>Welcome to FullStack Development - 1</h1>
        <h2>
          React JS Programming Week09 lab exsercise 
          </h2>
          <h3>Student Id: 101334946</h3>
          <h4>Arghawan Ghulam Siddiq</h4>
          <h5>George Brown College, Tornto</h5>
        <StudentDetails></StudentDetails>
      </header>
    </div>

  );
}

export default App;
